INSERT INTO `chr_specialization` (`MasterySpellID1`, `MasterySpellID2`, `Name`, `Name2`, `Description`, `ClassID`, `OrderIndex`, `PetTalentType`, `Role`, `PrimaryStatOrder`, `ID`, `IconFileDataID`, `Flags`, `AnimReplacementSetID`, `VerifiedBuild`) VALUES
(76613, 0, "Лед", "Лед", "Используя магию льда, замораживает врагов и разбивает их вдребезги.", 8, 2, 0, 2, 0, 64, 135846, 67, 362, 23911),
(77484, 0, "Послушание", "Послушание", "Использует магию для защиты союзников и исцеления их ран.", 5, 0, 0, 1, 0, 256, 135940, 67, 353, 23911),
(77486, 0, "Тьма", "Тьма", "Для уничтожения врагов пользуется магией Тьмы, предпочитая заклинания, наносящие периодический урон.", 5, 2, 0, 2, 0, 258, 136207, 11, 353, 23911),
(77220, 0, "Разрушение", "Разрушение", "Сеет хаос с помощью пламени, опаляющего и уничтожающего врагов.", 9, 2, 0, 2, 0, 267, 136186, 3, 357, 23911),
(168534, 0, "Стихии", "Стихии", "Заклинатель, который подчиняет себе разрушительные силы стихий.", 7, 0, 0, 2, 0, 262, 136048, 75, 369, 23911),
(77492, 0, "Баланс", "Баланс", "Обращается в мудрого совуха, и, балансируя между силами тайной магии и магии природы, уничтожает врагов на расстоянии.", 11, 0, 0, 2, 0, 102, 136096, 331, 363, 23911),
(77493, 0, "Сила зверя", "Сила зверя", "Обращается в кошку, чтобы царапать и кусать врагов.", 11, 1, 0, 2, 3, 103, 132115, 260, 363, 23911),
(155783, 0, "Страж", "Страж", "Принимает облик могучего медведя, чтобы поглощать урон и защищать союзников.", 11, 2, 0, 0, 3, 104, 132276, 4, 363, 23911),
(77495, 0, "Исцеление", "Исцеление", "Использует целительные заклинания периодического действия, чтобы поддерживать союзников.", 11, 3, 0, 1, 0, 105, 136041, 3, 363, 23911),
(77219, 0, "Демонология", "Демонология", "Повелитель демонов, подчиняющий себе демонические силы.", 9, 1, 0, 2, 0, 266, 136172, 3, 357, 23911),
(77223, 0, "Совершенствование", "Совершенствование", "Боец, использующий тотемы и разящий врагов оружием, усиленным духами стихий.", 7, 1, 0, 2, 2, 263, 237581, 260, 369, 23911),
(77485, 0, "Свет", "Свет", "Универсальный лекарь, который исцеляет одиночные цели и группы и может лечить даже после смерти.", 5, 1, 0, 1, 0, 257, 237542, 3, 353, 23911),
(77226, 0, "Исцеление", "Исцеление", "Лекарь, который взывает к духам предков и очистительной силе воды, чтобы исцелить раны союзников.", 7, 2, 0, 1, 0, 264, 136052, 3, 369, 23911),
(77215, 0, "Колдовство", "Колдовство", "Знаток темной магии, умеющий вытягивать из врагов силы и наносить периодический урон.", 9, 0, 0, 2, 0, 265, 136145, 67, 357, 23911),
(190740, 0, "Тайная магия", "Тайная магия", "Управляет энергией тайной магии, уничтожая своих противников разрушительными заклинаниями.", 8, 0, 0, 2, 0, 62, 135932, 3, 362, 23911),
(12846, 0, "Огонь", "Огонь", "Испепеляет врагов огненными шарами и всепожирающим пламенем.", 8, 1, 0, 2, 0, 63, 135810, 3, 362, 23911);
